import React, { useState } from "react";

const App = () => {
  let [count, setCount] = useState(0);

  return (
    <div>
      <h1>{count}</h1>
      <button onClick={() => setCount((count += count))}>Increase</button>
      <button onClick={() => setCount(count--)}>Decrease</button>
    </div>
  );
};

export default App;
